Описание автомобиля:
Количество владельцев: 1. 

Состояние кузова:
Без окрасов;
Сколы на капоте;
Трещина на лобовом стекле;
Вмятина водительской двери.

Техническое состояние:
Тех. жидкости по уровню;
Заменить ремень генератора;
Вариатор менялся на новый по гарантии в Оф дилера;
Лобовое стекло - не работает обогрев.

Описание автомобиля:  2 владельца, без ДТП. Комплектация Sport.
Есть сервисная книжка с отметками о прохождении планового обслуживания.
Подтвержденный пробег.
ОЖ в норме;
Масло ДВС средний уровень;
Нет защиты поддона ДВС;
Запотевание передней крышки ДВС;
С турбины ближе к сапуну гонит масло, турбина и патрубки все в масле
Заменить переднюю подушку ДВС
Заменить на задних продольных рычагах сайлентблоки
Запотевание раздаточной коробки.
Запотевание сальника левого переднего привода.
Не работает печка заднего пассажира.
Были ошибки удалены

Состояние кузова: крашен перед, следы демонтажа (крылья капот);
Справа под капотом сходит ЛКП в местах точечной сварки;
Бордюрка на всех дисках, оторвана наклейка с ВИН.

Описание автомобиля:
Количество владельцев: 1. 

Автомобиль числится в залоге. Кредит погашен. В ближайшее время уйдет из базы залогов.

Состояние кузова:
Заменен передний бампер;
Заклеена царапина на задней правой двери.
Треснуто крепление передней левой фары;
Передний бампер сошел с креплений;
Треснуто крепление  расширителя переднего левого крыла;

Техническое состояние:
Долить Масло в ДВС;
Долить Антифриз;
Есть небольшие толчки в КПП при переключении с R на D
